window.bookSummaryJSON = "<p><b>The Navy SEALs have been fighting terrorists around the world for over a decade. And for all that time, the Bandito Platoon SEALS from SEAL Team Seven have been on continuous combat rotation. Now they have drawn a shipboard assignment off Central America - an easy day. </b></p> <p><b>But for a Navy SEAL, the only easy day was yesterday.</b></p> <p>In a powerful story of global anti-terrorism inspired by real life missions, <i>Act of Valor</i> combines stunning combat scenes, up-to-the-minute battlefield technology, and heart-pumping emotion for the ultimate action adventure.</p> <p><i>Act of Valor</i> takes you deep into the secretive world of today’s most elite, highly trained group of warriors. When the rescue of a kidnapped CIA operative leads to the discovery of a deadly terrorist plot against the United States, a team of SEALs is dispatched on a worldwide manhunt. As the men of Bandito Platoon race to stop a coordinated attack that could kill and wound thousands of American civilians, they must balance their commitments to country, team, and their families back home.</p> <p>But each time they accomplish their mission, a new piece of intelligence reveals another shocking twist to the plot, which stretches from Chechnya to the Philippines and from Ukraine to Somalia. The widening operation sends the SEALs across the globe as they track the terrorist ring to the U.S.-Mexico border - where they engage in an epic firefight with potentially unimaginable consequences for America…</p>"; 
